import React from 'react'
import award from '../img/2.png'

function Award() {
    const size = {
        width:"80%",
        height:"250px"
    }
    return (
        <div className="w3-card-4" style={size}>
            <img src={award} alt="award" style={size} />
        </div>
    )
}

export default Award
